        {id:3,img:'images/feature-3.png'},
        {id:4,img:'images/feature-4.png'}
    ]);
    function displayimage(img){
       selectedimg(img)

    }
        return (
            <div>
                <div className="container">
                    <div className="row " style={{color:'#000',marginTop:200}}>
                        <h2>Here is Some Feature Images</h2>
